import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar,Nav} from 'react-bootstrap';

export default class NavbarCustom extends React.Component{

    state = {
        isLoggedIn: true
      }

    render(){
       return  <Navbar bg="dark" expand="lg" variant="dark" className="p-3">
  <Navbar.Brand href="#home">DevBlog</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
  <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#link">About</Nav.Link>
    </Nav>
    <Nav className="ml-auto">
        {this.state.isLoggedIn?<Nav.Link href="#link">Login</Nav.Link>:<Nav.Link href="#link">Login</Nav.Link>}

      <Nav.Link href="#link">Signup</Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
    }
}
